import React from 'react';

export default function Main({items}) {
    
    console.log(items);
    

    return(
        <div className='main-cont'>           
            <ul>
                {  items.length ? 
                    items.map((item) => {
                    return(
                        <li>{item}</li>
                    )                    
                }) : ''
            
            }
            </ul>
        </div> 
    )
}
